function Header() {
  return (
    <header className="header">
      <div className="logo">M</div>
      <nav>
        <ul>
          <li>Mentorship</li>
          <li><button className="say-hello-btn">Say Hello</button></li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
